import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu)
    await page.waitForSelector('.nav-menu', { timeout: 5000 });

    // Click the mobile menu trigger to open the mobile menu
    await page.click('.nav-menu');

    // Wait for the mobile menu overlay to appear (should have .show class)
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot of opened mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Wait for a visible category link (e.g., "Electronics") inside the mobile menu
    // Try to select an <a> with text "Electronics" inside the overlay
    const electronicsLink = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//a[contains(text(),"Electronics")]',
      { timeout: 5000 }
    );

    // Click the "Electronics" link in the mobile menu
    await electronicsLink.click();

    // Wait for main content to update (e.g., heading or products for Electronics)
    // Try to wait for a heading or product card with "Electronics"
    await page.waitForSelector('text=Electronics', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Re-open the mobile menu to test closing
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Wait for the close button in the mobile menu
    const closeBtn = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//button[contains(@class,"close-mobile-menu")]',
      { timeout: 5000 }
    );

    // Click the close button
    await closeBtn.click();

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Take screenshot after closing the mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    // Extract data: check if Electronics category is shown in main content
    const mainContentText = await page.textContent('body');
    const electronicsVisible = mainContentText.includes('Electronics');

    return {
      success: true,
      action: "Tested mobile menu navigation: open menu, navigate to Electronics, close menu.",
      extractedData: {
        electronicsCategoryVisible: electronicsVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
